  @override
  @optionalTypeArgs
  TResult? mapOrNull<TResult extends Object?>({
    TResult? Function(CheckDownloadState value)? check,
    TResult? Function(ErrorCheckDownloadState value)? errorCheck,
    TResult? Function(NoUpdateState value)? noUpdate,
    TResult? Function(CheckValidationDownloadState value)?
        checkValidationDownload,
    TResult? Function(ValidateDownloadState value)? validateDownload,
    TResult? Function(RefuseDownloadState value)? refuseDownload,
  }) {
    return refuseDownload?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(CheckDownloadState value)? check,
    TResult Function(ErrorCheckDownloadState value)? errorCheck,
    TResult Function(NoUpdateState value)? noUpdate,
    TResult Function(CheckValidationDownloadState value)?
        checkValidationDownload,
    TResult Function(ValidateDownloadState value)? validateDownload,
    TResult Function(RefuseDownloadState value)? refuseDownload,
    required TResult orElse(),
  }) {
    if (refuseDownload != null) {
      return refuseDownload(this);
    }
    return orElse();
  }
}

abstract class RefuseDownloadState implements CheckAndValidateState {
  const factory RefuseDownloadState() = _$RefuseDownloadStateImpl;
}
